INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 1, 2, 1, 126401, 2002, "2023/06/30 12:00:00", 1.47, "2023/09/22 14:59:59", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", -470.0, "クローチェ", 1, 10001);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 1, 1, 2, 126401, 2002, "2023/06/30 12:00:00", 2.15, "2023/09/22 14:59:59", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", -470.0, "クローチェ", 2, 10002);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 1, 2, 1, 126501, 2002, "2023/06/30 12:00:00", 0.0, "2023/09/22 14:59:59", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", -470.0, "ライラエル", 2, 10003);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 1, 1, 2, 126501, 2002, "2023/06/30 12:00:00", 0.0, "2023/09/22 14:59:59", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", -470.0, "ライラエル", 1, 10004);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 2, 2, 1, 127702, 2002, "2023/09/15 15:00:00", 0.0, "2023/12/22 14:59:59", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", -470.0, "リンド", 2, 10005);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 2, 2, 2, 127702, 2002, "2023/09/15 15:00:00", 0.0, "2023/12/22 14:59:59", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", -470.0, "リンド", 2, 10006);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 2, 1, 1, 127802, 2002, "2023/09/15 15:00:00", 0.0, "2023/12/22 14:59:59", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", -470.0, "ヴルム", 1, 10007);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 2, 1, 2, 127802, 2002, "2023/09/15 15:00:00", 6.5, "2023/12/22 14:59:59", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", -470.0, "ヴルム", 2, 10008);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 3, 1, 1, 129602, 2002, "2023/12/15 15:00:00", 0.0, "2024/03/22 14:59:59", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", -470.0, "アネモネ", 2, 10009);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 3, 1, 2, 129602, 2002, "2023/12/15 15:00:00", 0.0, "2024/03/22 14:59:59", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", -470.0, "アネモネ", 2, 10010);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 3, 1, 1, 129701, 2002, "2023/12/15 15:00:00", 0.0, "2024/03/22 14:59:59", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", -470.0, "ネフィ=ネラ", 1, 10011);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 3, 1, 2, 129701, 2002, "2023/12/15 15:00:00", 6.2, "2024/03/22 14:59:59", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", -470.0, "ネフィ=ネラ", 2, 10012);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 4, 5, 1, 130301, 2002, "2024/03/15 15:00:00", 3.1, "2024/06/22 14:59:59", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", -470.0, "カノン", 3, 10013);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 4, 2, 2, 130301, 2002, "2024/03/15 15:00:00", 6.15, "2024/06/22 14:59:59", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", -470.0, "カノン", 3, 10014);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 4, 2, 1, 130401, 2002, "2024/03/15 15:00:00", 0.0, "2024/06/22 14:59:59", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", -470.0, "ナーナ", 2, 10015);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 4, 1, 2, 130401, 2002, "2024/03/15 15:00:00", 3.35, "2024/06/22 14:59:59", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", -470.0, "ナーナ", 2, 10016);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 5, 1, 1, 130502, 2002, "2024/06/15 15:00:00", 0.0, "2024/09/22 14:59:59", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", -470.0, "ホウオウ", 1, 10017);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 5, 1, 2, 130502, 2002, "2024/06/15 15:00:00", 3.18, "2024/09/22 14:59:59", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", -470.0, "ホウオウ", 2, 10018);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 5, 4, 3, 130503, 2002, "2024/06/15 15:00:00", 0.0, "2024/09/22 14:59:59", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", -470.0, "ホウオウ", 4, 10019);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 5, 2, 1, 123301, 2002, "2024/06/15 15:00:00", 4.9, "2024/09/22 14:59:59", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", -470.0, "ネア", 1, 10020);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 5, 2, 2, 123301, 2002, "2024/06/15 15:00:00", 4.8, "2024/09/22 14:59:59", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", -470.0, "ネア", 1, 10021);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 6, 1, 1, 133301, 2002, "2024/09/15 15:00:00", 4.922, "2024/12/22 14:59:59", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", -470.0, "カリザ", 3, 10022);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 6, 5, 2, 133301, 2002, "2024/09/15 15:00:00", 9.638, "2024/12/22 14:59:59", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", -470.0, "カリザ", 3, 10023);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 6, 2, 1, 133401, 2002, "2024/09/15 15:00:00", 2.88, "2024/12/22 14:59:59", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", -470.0, "ミーア", 1, 10024);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 6, 1, 2, 133401, 2002, "2024/09/15 15:00:00", 4.818, "2024/12/22 14:59:59", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", -470.0, "ミーア", 5, 10025);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 7, 1, 1, 133002, 2002, "2024/12/15 15:00:00", 1.78, "2025/03/22 14:59:59", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", -470.0, "グレイス", 2, 10026);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 7, 7, 2, 133002, 2002, "2024/12/15 15:00:00", 6.15, "2025/03/22 14:59:59", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", -470.0, "グレイス", 1, 10027);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 7, 2, 1, 133102, 2002, "2024/12/15 15:00:00", 4.28, "2025/03/22 14:59:59", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", -470.0, "ヴァイオレット", 6, 10028);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 7, 1, 2, 133102, 2002, "2024/12/15 15:00:00", 0.0, "2025/03/22 14:59:59", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", -470.0, "ヴァイオレット", 1, 10029);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 8, 1, 1, 136902, 2002, "2025/03/15 15:00:00", 5.53, "2025/06/23 14:59:59", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", -470.0, "ルルィ", 2, 10030);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 8, 7, 2, 136902, 2002, "2025/03/15 15:00:00", 6.05, "2025/06/23 14:59:59", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", -470.0, "ルルィ", 9, 10031);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 8, 1, 1, 137001, 2002, "2025/03/15 15:00:00", 0.0, "2025/06/23 14:59:59", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", -470.0, "デュラン", 2, 10032);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 8, 1, 2, 137001, 2002, "2025/03/15 15:00:00", 0.0, "2025/06/23 14:59:59", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", -470.0, "デュラン", 2, 10033);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 9, 2, 1, 135902, 2002, "2025/06/16 15:00:00", 0.0, "2025/09/22 14:59:59", "おう\n好きなもん持ってきな", -470.0, "サツキ", 2, 10034);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 9, 6, 2, 135902, 2002, "2025/06/16 15:00:00", 4.935, "2025/09/22 14:59:59", "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", -470.0, "サツキ", 1, 10035);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 9, 5, 1, 135802, 2002, "2025/06/16 15:00:00", 7.441, "2025/09/22 14:59:59", "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", -470.0, "ユキノ", 2, 10036);
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (0.0, 9, 7, 2, 135802, 2002, "2025/06/16 15:00:00", 0.0, "2025/09/22 14:59:59", "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", -470.0, "ユキノ", 7, 10037);
